import React from 'react';
import styled from 'styled-components';
import { Link, useNavigate } from 'react-router-dom';

// Top bar
const TopBar = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
  font-size: 1rem;
  padding: 18px 0 0 0;
  max-width: 1300px;
  margin: 0 auto;
`;
const TopLeft = styled.div`
  color: #222;
  font-weight: 600;
  display: flex;
  align-items: center;
  gap: 12px;
`;
const Epaper = styled.span`
  color: #b3001b;
  font-weight: 700;
  margin-left: 6px;
`;
const TopRight = styled.div`
  display: flex;
  align-items: center;
  gap: 24px;
`;
const Account = styled.div`
  color: #222;
  font-weight: 600;
  display: flex;
  align-items: center;
  gap: 4px;
`;
const SubscribeBtn = styled.button`
  background: #b3001b;
  color: #fff;
  font-weight: 700;
  border: none;
  border-radius: 6px;
  padding: 10px 28px;
  font-size: 1.1rem;
  cursor: pointer;
`;

// Logo
const LogoRow = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  margin: 0 auto;
  padding: 0;
`;
const LogoImg = styled.img`
  height: 70px;
  margin: 0 auto;
`;

// Nav bar
const NavBar = styled.nav`
  display: flex;
  align-items: center;
  justify-content: center;
  gap: 0;
  border-bottom: 1px solid #eee;
  margin-top: 10px;
  background: #fff;
`;
const NavInner = styled.div`
  display: flex;
  align-items: center;
  width: 100%;
  max-width: 1300px;
  margin: 0 auto;
  padding: 0 16px;
`;
const NavLeft = styled.div`
  display: flex;
  align-items: center;
  gap: 18px;
  min-width: 180px;
`;
const Hamburger = styled.button`
  background: none;
  border: none;
  font-size: 2rem;
  cursor: pointer;
  display: flex;
  align-items: center;
`;
const SearchBox = styled.div`
  display: flex;
  align-items: center;
  gap: 6px;
  font-size: 1.1rem;
`;
const SearchIcon = styled.span`
  display: flex;
  align-items: center;
  font-size: 1.3rem;
`;
const NavLinks = styled.ul`
  display: flex;
  align-items: center;
  gap: 32px;
  margin: 0 auto;
  padding: 0;
  list-style: none;
  font-size: 1.5rem;
  font-weight: 700;
  font-family: 'Georgia', serif;
`;
const NavLink = styled(Link)`
  color: #111;
  text-decoration: none;
  &:hover {
    color: #b3001b;
  }
`;
const PremiumWrap = styled.li`
  display: flex;
  align-items: center;
  gap: 7px;
`;
const PremiumCircle = styled.span`
  background: #ffd600;
  color: #222;
  font-weight: 700;
  border-radius: 50%;
  width: 28px;
  height: 28px;
  display: flex;
  align-items: center;
  justify-content: center;
  font-size: 1.1rem;
`;

function getToday() {
  const d = new Date();
  return d.toLocaleDateString('en-US', { year: 'numeric', month: 'long', day: 'numeric' });
}

function Header() {
  const navigate = useNavigate();

  return (
    <header style={{background: '#fff', borderBottom: '1px solid #eee'}}>
      {/* Top Bar */}
      <TopBar>
        <TopLeft>
          <span>{getToday()}</span>
          <Epaper>e-Paper</Epaper>
        </TopLeft>
        <TopRight>
          <Account>
            Account
            <span style={{fontSize: '1.2em', marginLeft: '2px'}}>&#128100;</span>
          </Account>
          <SubscribeBtn>SUBSCRIBE</SubscribeBtn>
        </TopRight>
      </TopBar>
      {/* Logo Row */}
      <LogoRow>
        <LogoImg src={process.env.PUBLIC_URL + '/logo.png'} alt="The Hindu Logo" />
      </LogoRow>
      {/* Nav Bar */}
      <NavBar>
        <NavInner>
          <NavLeft>
            <Hamburger aria-label="Menu">
              <svg width="28" height="28" viewBox="0 0 24 24"><rect y="4" width="24" height="2" rx="1"/><rect y="11" width="24" height="2" rx="1"/><rect y="18" width="24" height="2" rx="1"/></svg>
            </Hamburger>
            <SearchBox>
              <SearchIcon>
                <svg width="20" height="20" viewBox="0 0 24 24"><circle cx="11" cy="11" r="8" stroke="#111" strokeWidth="2" fill="none"/><line x1="21" y1="21" x2="16.65" y2="16.65" stroke="#111" strokeWidth="2"/></svg>
              </SearchIcon>
              <span>Search</span>
            </SearchBox>
          </NavLeft>
          <NavLinks>
            <li><NavLink to="/category/india">India</NavLink></li>
            <li><NavLink to="/category/world">World</NavLink></li>
            <li><NavLink to="/category/movies">Movies</NavLink></li>
            <li><NavLink to="/category/sport">Sport</NavLink></li>
            <li><NavLink to="/category/data">Data</NavLink></li>
            <li><NavLink to="/category/health">Health</NavLink></li>
            <li><NavLink to="/category/opinion">Opinion</NavLink></li>
            <li><NavLink to="/category/science">Science</NavLink></li>
            <li><NavLink to="/category/business">Business</NavLink></li>
            <PremiumWrap>
              <PremiumCircle>TH</PremiumCircle>
              <NavLink to="/category/premium">Premium</NavLink>
            </PremiumWrap>
          </NavLinks>
        </NavInner>
      </NavBar>
    </header>
  );
}

export default Header;
